		function startTimer() {
			if (isPaused == false) {
				if (sec == 60) {
					min++
					sec = 0;
					check = 0;
				}
				if (sec < 10) {
					sec = "0" + sec;
				}
				if (min < 0) {
					if (check == 0) {
						min = "0" + min;
						check = 1;
					}
				} else {
					check = 0;
				}
				myClock = min + ":" + sec;
		
				sec++;
		
				TimerBox.timerText.text = myClock;
				if (mashovExist == false) {
					timeNotPlayed++;
				}
			}
			if (timeNotPlayed == 30) {
				PauseScreen();
			}
		}
		
