		//תזוזה של החתול והפסקת תזוזה בהרמת האצבע מהמקלדת
		function kittyMovement() {
			if (getkittyCart.x >= 1019) {
				isKittyRight = false;
			}
			if (getkittyCart.x <= 0) {
				isKittyLeft = false;
			}
			if (mashovExist == true) {
				isKittyRight = false;
				isKittyLeft = false;
			} else {
				if (isKittyRight == true && getkittyCart.x < 1019) {
					getkittyCart.x += kittySpeed;
				} else if (isKittyLeft == true && getkittyCart.x > 0) {
					getkittyCart.x -= kittySpeed;
				}
			}
		}
		
		var kittyFrames = 1;
		
		function keyPressed(e) {
			if (mashovBool == false) {
				timeNotPlayed = 0;
				if (e.keyCode == 39 && getkittyCart.x < 1019) //אמרנו שמסגרת העץ היא 67 פיקסלים	
				{
					getkittyCart.gotoAndPlay((kittyFrames++) % 27 + 1);
					//getkittyCart.x += kittySpeed;
					isKittyRight = true;
					isKittyLeft = false;
		
				}
				if (e.keyCode == 37 && getkittyCart.x > 0) {
					getkittyCart.gotoAndPlay((kittyFrames++) % 27 + 1);
					//getkittyCart.x -= kittySpeed;
					isKittyRight = false;
					isKittyLeft = true;
				}
			}
		
		}
		
		function keyNotPressed(e) {
			isKittyRight = false;
			isKittyLeft = false;
			getkittyCart.gotoAndStop(1);
			kittyFrames = 1;
		}
